package com.loyauty.web.struts.action.orders;

import java.io.File;
import java.io.FileInputStream;
import java.io.InputStream;
import java.text.SimpleDateFormat;
import java.util.ArrayList;
import java.util.Collection;
import java.util.Date;
import java.util.List;
import javax.servlet.http.HttpSession;
import lombok.Getter;
import lombok.Setter;
import com.loyauty.exception.ServiceLocatorException;
import com.loyauty.service.core.dto.OrdersDTO;
import com.loyauty.service.orders.OrdersService;
import com.loyauty.web.struts.action.LoyautyAction;

public class OrdersAdminXLS extends LoyautyAction{
	private static final long serialVersionUID = -8730372014253451459L;

	private OrdersService orderService;
	@Getter @Setter
	private InputStream fileInputStream;
	@Getter @Setter
	private String fileName="";
	@Getter @Setter
	private String lsOrderIdToPrint;
	private List<OrdersDTO>listOrdersDTO;
	@Getter @Setter
	private Long tansformAutoSignal;
	@Getter @Setter
	private Long init;
	@Getter @Setter
	private Long tansformManSignal;
	@Getter @Setter
	private Long treatOrderPageSignal;
	@Getter @Setter
	private Long reportOrderPageSignal;
	@Getter @Setter
	private Long selectedOrdersListSignal;
	@Getter @Setter
	private Long allProgressListOrdersSignal;
	@Getter @Setter
	private String showPopupConfirmInsert;
	@Getter @Setter
	private Long printAllOrdersSignal;
	@Getter @Setter
	private String message="";
	Collection list;

	public OrdersAdminXLS() throws ServiceLocatorException {
		super();	
		listOrdersDTO=new ArrayList<OrdersDTO>();
		orderService = getServiceLocator().getOrderService();
	}

	@Override  
	public String execute() throws Exception {	
		HttpSession session = request.getSession(true);
		String filePath = session.getServletContext().getRealPath("/");
		String filePathData=filePath+"WEB-INF/jsp/orders/data/";
		if((treatOrderPageSignal!=null && treatOrderPageSignal!=0L)||
		   (reportOrderPageSignal!=null && reportOrderPageSignal!=0L)){
			if(selectedOrdersListSignal!=null && selectedOrdersListSignal!=0L){
				if((treatOrderPageSignal!=null && treatOrderPageSignal!=0L))
					listOrdersDTO= (List<OrdersDTO>)session.getAttribute("listOrdersDTOTreat");
				if((reportOrderPageSignal!=null && reportOrderPageSignal!=0L))
					listOrdersDTO= (List<OrdersDTO>)session.getAttribute("listOrdersDTOReport");
			}else if(allProgressListOrdersSignal!=null && allProgressListOrdersSignal!=0L){
				SimpleDateFormat frm=new SimpleDateFormat("dd/MM/yyyy");
				Date date=frm.parse("01/01/1928");
				String userLogin="";
				String status="prog";
				listOrdersDTO=orderService.getOrdersByDateClientLikeLsOrderId(date, userLogin, "", status);
			}
		}else if(init!=null && init!=0L ){
				SimpleDateFormat frm=new SimpleDateFormat("dd/MM/yyyy");
				Date date=frm.parse("01/01/1928");
				String userLogin="";
				String status="prog";
				listOrdersDTO=orderService.getOrdersByDateClientLikeLsOrderId(date, userLogin, "", status);	
		}
		try{
			/*-------------------- Create a file XLS from orders list ---------------------
					  The system will create a XLS file with the client login name
	 		 ------------------------------------------------------------------------------*/
			//
			if(reportOrderPageSignal!=null && reportOrderPageSignal!=0L){
				orderService.generateAdminXLS(listOrdersDTO, filePathData,true);
				fileInputStream = new FileInputStream(new File( filePathData+"ordersAdminExport.xls"));
				fileName="ordersAdmin.xls";
			}else{
				//orderService.generateAdminXLS(listOrdersDTO, filePathData,false);
				orderService.generateAdminEstTool(listOrdersDTO, filePathData);
				fileInputStream = new FileInputStream(new File( filePathData+"EST_TOOL.txt"));
				fileName="EST_TOOL.txt";

				//fileInputStream = new FileInputStream(new File( filePathData+"EST_TOOL.xls"));
				//fileName="EST_TOOL.xls";
			}

			return SUCCESS;
		}catch (Exception e) {
			System.out.println("Erreur");
			return ERROR;
		}
	}

}

